import { Component } from '@angular/core';
import { HttpClient, HttpHeaders } from "@angular/common/http";

@Component({
  selector: 'app-list',
  templateUrl: './list.component.html',
  styleUrls: ['./list.component.scss']
})
export class ListComponent {

  constructor(private http: HttpClient) { }

  ngOnInit(){
    this.fetchData();
  }

  fetchData() {

    const headers = new HttpHeaders({
      'Content-Type': 'application/json',
      'Authorization': 'Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyIjp7InVzZXJuYW1lIjoiUHVzaGthciBTdXRhciIsImVtYWlsIjoicHVzaGthckB5b3BtYWlsLmNvbSIsImlkIjoiNjY1NjBmYWFkZWJiYWI5ZjRiNTNiZmJhIn0sImlhdCI6MTcxNzAwMTgwMSwiZXhwIjoxNzE3MDA3ODAxfQ.SuP0Hacp_cPjlZLPmp603DJF4MwfSThrYQ6MYZz1sf8'  // Replace with your token
    });
    this.http.get("http://localhost:5000/api/contacts", {headers}).subscribe(data => {

      console.log(data);

    });

  }
}
